define(function(require){
	
	var dbObject = {

		db: window.openDatabase("mnemo", "2.0", "Mnemo DB", 1000000),

		query: function(str,arr,res){
			this.db.transaction(function(tx){
				tx.executeSql(str,arr,res);
			},function(err){
				console.log(err.message);
			});
		}.bind(this),

		getFullSets:function(fn){
			this.getSets(function(sets){
				for(var i = 0; i < sets.rows.length; i++)
				{
					var set= sets.rows.item(i);
					window.App.sets[set.set_id]=set;
					window.App.sets[set.set_id].cards=[];
				}});
			setTimeout(function(){  
				window.App.sets.forEach(function(el){
					this.getCards(el.set_id, function(cards){
						var cardsTmp=[];
						for(var j = 0; j < cards.rows.length; j++)
						{
							cardsTmp[j] = cards.rows.item(j);
						}
						el.cards=cardsTmp;
					});
				}.bind(this));
			}.bind(this),500);
		},
		getIcons:function(fn){
			this.selectQuery("SELECT * FROM icons",[],fn);			
		},
		getSets:function(fn){
			this.selectQuery("SELECT s.id as set_id, s.name, s.difficulty, s.description, i.icon_value AS icon FROM sets s LEFT JOIN icons i ON i.id = s.icon_id",[],fn);
		},
		getCards:function(id,fn){
			this.selectQuery("SELECT c.id as card_id, c.front, c.difficulty, c.back, cc.color_value AS color, c.set_id FROM cards c LEFT JOIN sets s ON c.set_id=s.id LEFT JOIN colors cc ON c.color_id = cc.id WHERE c.set_id=(?)",[id],fn);
		},
		deleteSet:function(setid){
			this.execQuery("DELETE FROM sets WHERE id=(?)",[setid]);
		},

		updateSet:function(setName, setIcon, setId){
			this.execQuery("UPDATE sets SET name=(?), icon_id=(?) WHERE id = (?)",[setName,setIcon,setId])
		},
		deleteCard:function(cardid){
			this.execQuery("DELETE FROM cards WHERE id=(?)",[cardid]);
		},
		saveSet:function(name,desc,icon){
			this.db.transaction(function(tx){
				tx.executeSql("INSERT INTO sets(name,difficulty,description,icon_id) VALUES (?,?,?,?)",[name,0.5,desc,icon]);
			},function(err){
				console.log(err.message);
			});
		},

		saveCard:function(front,back,color,set){
			//card difficulty = (card.error / (card.success + card.error)) * 100%
			this.db.transaction(function(tx){  
				tx.executeSql("INSERT INTO cards(front,back,color_id,set_id) VALUES (?,?,?,?)",[front,back,color,set]);
			},function(err){
				console.log(err.message);
			});
		},
		execQuery: function(str,arr){
			this.db.transaction(
				function(tx){
					tx.executeSql(str,arr,
						function(tx){
						}.bind(this));
				}.bind(this),
				function(err){
					console.log(err.message);
				}
				);

		},
		selectQuery: function(str,arr,callback){
			this.db.transaction(
				function(tx){
					tx.executeSql(str,arr,
						function(tx,res){
							this.SQLResult=res.rows;
							if(callback){
								callback(res);						
							}
						}.bind(this));
				}.bind(this),
				function(err){
					console.log(err.message);
				}
				);
		},

		prepareDb: function(){
			this.db=window.openDatabase("mnemo", "2.0", "Mnemo DB", 1000000),
			this.db.transaction(
				function(tx) {
                    //create table
                    this.prepareTables(tx);
                    this.prepareIcons(tx);
                    this.prepareColors(tx); 

                }.bind(dbObject), function(err){
                	console.log("Error: " + err.message);
                });  
		}.bind(this),

		prepareTables:function(tx){
			tx.executeSql("CREATE TABLE IF NOT EXISTS icons(id INTEGER PRIMARY KEY AUTOINCREMENT, icon_value TEXT, icon_name TEXT)");
			tx.executeSql("CREATE TABLE IF NOT EXISTS sets(id INTEGER PRIMARY KEY AUTOINCREMENT,description TEXT,difficulty FLOAT, name TEXT,icon_id INTEGER,FOREIGN KEY(icon_id) REFERENCES icons(id))");
			tx.executeSql("CREATE TABLE IF NOT EXISTS colors(id INTEGER PRIMARY KEY AUTOINCREMENT,color_value TEXT)");
			tx.executeSql("CREATE TABLE IF NOT EXISTS cards(id INTEGER PRIMARY KEY AUTOINCREMENT,front TEXT,back TEXT,difficulty FLOAT DEFAULT 0.5,success INTEGER DEFAULT 0, error INTEGER DEFAULT 0, set_id INTEGER,color_id INTEGER,FOREIGN KEY(color_id) REFERENCES colors(id),FOREIGN KEY(set_id) REFERENCES sets(id))");        
		},

		prepareIcons:function(tx){
			//base64
			var icons = [
			{'id':1,'name':'alien','val':"data:image/png;base64,"},
			{'id':2,'name':'atom', 'val':"data:image/png;base64,"},
			{'id':3,'name':'brain', 'val':"data:image/png;base64,"},
			{'id':4,'name':'compass','val':"data:image/png;base64,"},
			{'id':5,'name':'dna','val':"data:image/png;base64,"}, 
			{'id':6,'name':'earth-globe','val':"data:image/png;base64,"},
			{'id':7,'name':'flask','val': "data:image/png;base64,"},
			{'id':8,'name':'gears','val': "data:image/png;base64,"},
			{'id':9,'name':'lightbulb','val': "data:image/png;base64,"},
			{'id':10,'name':'pulse','val': "data:image/png;base64,"},
			{'id':11,'name':'rat','val':"data:image/png;base64,"},
			{'id':12,'name':'scientist','val':"data:image/png;base64,"}
			];

			tx.executeSql("DELETE FROM icons");
			for(var i=0; i<icons.length; i++){
				tx.executeSql("REPLACE INTO icons(id,icon_value, icon_name) VALUES (?,?,?)",[icons[i].id, icons[i].val,icons[i].name]);
			}           
		},

		prepareColors:function(tx){
			var colors = [	
			{'id':1,'val':'#ff9'}, //light yellow
			{'id':2,'val':'#fff'}, //white
			{'id':3,'val':'#99f'}, //light purple
			{'id':4,'val':'#55ce53'}, // green
			{'id':5,'val':'#f9a'}, //pink
			{'id':6,'val':'#55f'}  //dark blue
			];
			tx.executeSql("DELETE FROM colors");
			for(var i=0; i<colors.length; i++){
				tx.executeSql("REPLACE INTO colors(id,color_value) VALUES (?,?)",[colors[i].id, colors[i].val]);
			}      
		}

	};

	return dbObject;
});